	(2, 1, 1, 1, 13, 2, '<span class=\'questions\' style=\'font-size: 14px;font-family: "Source Sans Pro", sans-serif;font-weight: bold;\'>What are Jennifer Lewis\'s top three strengths and how did they apply them to their work since the last review?</span><br/>   - <span class=\'answer\'>Great team player</span><br/>   - <span class=\'answer\'>Passionate and dedicated towards work</span><br/>   - <span class=\'answer\'>Quick Learner</span><br/><br/><br/><span class=\'questions\' style=\'font-size: 14px;font-family: "Source Sans Pro", sans-serif;font-weight: bold;\'>What are up to three wins you want to celebrate with Jennifer Lewis since their last review? What led to those wins?</span><br/>   - <span class=\'answer\'>Customer engagement</span><br/>   - <span class=\'answer\'>Owning things end to end</span><br/>   - <span class=\'answer\'>Approachable</span><br/><br/><br/><span class=\'questions\' style=\'font-size: 14px;font-family: "Source Sans Pro", sans-serif;font-weight: bold;\'>Where would you like Jennifer Lewis to improve? What are up to three opportunities for growth you want Jennifer Lewis to focus on before the next review? What next steps do you want them to take?</span><br/>   - <span class=\'answer\'>Close more deals</span><br/>   - <span class=\'answer\'>Market research</span><br/>   - <span class=\'answer\'>Peer support</span><br/><br/><br/><span class=\'questions\' style=\'font-size: 14px;font-family: "Source Sans Pro", sans-serif;font-weight: bold;\'>What impact do you want Jennifer Lewis to have on the company\'s next quarter? What next steps do they need to take?</span><br/>   - <span class=\'answer\'>Additional customer integration</span><br/>', '<span class=\'questions\' style=\'font-size: 14px;font-family: "Source Sans Pro", sans-serif;font-weight: bold;\'>Jennifer Lewis is ready for a promotion today</span><br/>   - <span class=\'answer\'>Yes</span><br/><br/><br/><span class=\'questions\' style=\'font-size: 14px;font-family: "Source Sans Pro", sans-serif;font-weight: bold;\'>Jennifer Lewis is at risk for low performance</span><br/>   - <span class=\'answer\'>Yes</span><br/><br/><br/><span class=\'questions\' style=\'font-size: 14px;font-family: "Source Sans Pro", sans-serif;font-weight: bold;\'>Given what I know of Jennifer Lewiss current performance, and if it were my money, I would award them the highest possible increase and bonus</span><br/>   - <span class=\'answer\'>Agree</span><br/><br/><br/><span class=\'questions\' style=\'font-size: 14px;font-family: "Source Sans Pro", sans-serif;font-weight: bold;\'>Given how well I know Jennifer Lewis works with others, I would always want them on my team:</span><br/>   - <span class=\'answer\'>Agree</span><br/><br/><br/><span class=\'questions\' style=\'font-size: 14px;font-family: "Source Sans Pro", sans-serif;font-weight: bold;\'>Given what I know of Jennifer Lewiss performance, if Jennifer Lewis got a job offer somewhere else, I would feel</span><br/>   - <span class=\'answer\'>**Relieved.**<br>[First Name] could do their best work elsewhere</span><br/>', '<span class=\'questions\' style=\'font-size: 14px;font-family: "Source Sans Pro", sans-serif;font-weight: bold;\'>What are your top three strengths and how did you apply them to your work since your last review?</span><br/>   - <span class=\'answer\'>Through</span><br/>   - <span class=\'answer\'>Quick learner</span><br/>   - <span class=\'answer\'>Detailed</span><br/><br/><br/><span class=\'questions\' style=\'font-size: 14px;font-family: "Source Sans Pro", sans-serif;font-weight: bold;\'>What are up to three wins you want to celebrate since your last review? What led to those wins?</span><br/>   - <span class=\'answer\'>Created demo sessions videos</span><br/>   - <span class=\'answer\'>Adopted customers feedback</span><br/>   - <span class=\'answer\'>Build customer engagement jolt form</span><br/><br/><br/><span class=\'questions\' style=\'font-size: 14px;font-family: "Source Sans Pro", sans-serif;font-weight: bold;\'>Where would you like to improve? What are up to three opportunities for growth to focus on before your next review? What next steps do you want to take? </span><br/>   - <span class=\'answer\'>Competitive analysis and research</span><br/><br/><br/><span class=\'questions\' style=\'font-size: 14px;font-family: "Source Sans Pro", sans-serif;font-weight: bold;\'>What impact do you want to have on the company before your next review? What next steps do you want to take?</span><br/>   - <span class=\'answer\'>Process simplification</span><br/>', 'ACTIVE', '2021-02-25 21:15:20', '2021-02-25 21:15:20'),
