	(69, 1, 1, 'buildReport', '	\n{\n  "$schema": "http://json-schema.org/draft-04/schema#",\n  "title": "build report",\n  "description": "build report validation model",\n  "type": "object",\n  "properties": {\n    "name": {\n      "description": "name of build report",\n      "type": "string",\n      "minLength": 3,\n      "maxLength": 50,\n      "pattern": "^[-_ a-zA-Z0-9]{3,50}$"\n    },\n    "description": {\n      "description": "description of build report",\n      "type": "string",\n      "minLength": 3,\n      "maxLength": 100,\n      "pattern": "^[-_ a-zA-Z0-9]{3,100}$"\n    },\n	"share": {\n      "description": "share of build report",\n      "type": "string",\n      "enum": [\n	    "DEVELOPER",\n		"MANAGER",\n		"HR"\n	  ]\n    },\n    "dateAtFooter": {\n      "description": "date at footer of build report",\n      "type": "boolean"\n    },\n	"pageNoAtFooter": {\n      "description": "page no at footer of build report",\n      "type": "boolean"\n    },\n	"xAxisField": {\n      "description": "template rows of build report",\n      "$ref": "#/definitions/encId"\n    },\n    "templateRows": {\n      "description": "template rows of build report",\n      "type": "object",\n      "$ref": "#/definitions/templateRow"\n    },\n	"ruleTypes": {\n      "description": "rules of build report",\n      "type": "array",\n      "items": {\n        "type": "string",\n		"minLength": 8\n      }\n    },\n    "chageStatus": {\n      "description": "change status of build report",\n      "type": "boolean"\n    }\n  },\n  "required": [\n    "name",\n    "description",\n	"share",\n	"dateAtFooter",\n	"pageNoAtFooter",\n    "templateRows",\n	"ruleTypes"\n  ],\n  "definitions": {\n   "encId": {\n      "type": "string",\n      "minLength": 8\n    },\n	"templateRow": {\n      "type": "object",\n      "properties": {\n        "dataRows": {\n			"type": "array",\n			"minItems": 1,\n			"maxItems": 10,\n			"items": {\n				"type": "object",\n				"$ref": "#/definitions/Row"\n			}\n        },\n        "filterRows": {\n            "type": "array",\n			"minItems": 1,\n			"maxItems": 10,\n			"items": {\n				"type": "object",\n				"$ref": "#/definitions/Row"\n			}\n        }\n      }\n    },\n    "Row": {\n      "type": "object",\n      "properties": {\n        "id": {\n          "description": "template row index of build report",\n          "type": "number",\n          "minimum": 0\n        },\n        "fields": {\n          "description": "template row field of build report",\n          "type": "array",\n          "minItems": 0,\n          "maxItems": 10,\n          "items": {\n            "type": "object",\n            "$ref": "#/definitions/TemplateRowField"\n          }\n        }\n      }\n    },\n    "TemplateRowField": {\n      "type": "object",\n      "properties": {\n        "id": {\n          "description": "template row field id of build report",\n          "type": "string",\n          "minLength": 8\n        },\n        "name": {\n          "description": "template row field name of build report",\n          "type": "string"\n        }\n      }\n    }\n  }\n}', 'ACTIVE', '2018-03-23 10:56:46', '2019-04-30 21:22:16'),
	(70, 1, 1, 'customProperty', '{\n  "$schema": "http://json-schema.org/draft-04/schema#",\n  "title": "custom property",\n  "description": "custom property validation model",\n  "type": "object",\n  "properties": {\n    "name": {\n      "description": "name of custom property",\n      "type": "string",\n      "minLength": 3,\n      "maxLength": 50,\n      "pattern": "^[-_ a-zA-Z0-9]{3,50}$"\n    },\n    "description": {\n      "description": "description of  custom property",\n      "type": "string",\n      "minLength": 3,\n      "maxLength": 100,\n      "pattern": "^[-_ a-zA-Z0-9]{3,100}$"\n    }\n  },\n  "required": [\n    "name",\n    "description"\n  ]\n}', 'ACTIVE', '2018-03-23 10:56:46', '2018-08-14 18:20:32'),
	(71, 1, 1, 'customPropertyRecords', '{\n  "$schema": "http://json-schema.org/draft-04/schema#",\n  "title": "alert view",\n  "description": "custom property details validation model",\n  "type": "object",\n  "properties": {\n    "id": {\n      "description": "id of employee",\n      "$ref": "#/definitions/encId"\n    },\n    "details": {\n      "description": "details of custom property records",\n      "type": "array",\n      "items": {\n        "type": "object",\n        "$ref": "#/definitions/recordRow"\n      }\n    }\n  },\n  "required": [\n    "id",\n    "details"\n  ],\n  "definitions": {\n    "encId": {\n      "type": "string",\n      "minLength": 8\n    },\n    "recordRow": {\n      "type": "object",\n      "properties": {\n        "name": {\n          "description": "name of property",\n          "type": "string"\n        },\n        "value": {\n          "description": "value of property",\n          "type": "string"\n        }\n      }\n    }\n  }\n}', 'ACTIVE', '2018-03-23 10:56:46', '2018-08-15 12:25:33'),
	(72, 1, 1, 'planningBudget', '{\n  "$schema": "http://json-schema.org/draft-04/schema#",\n  "title": "planningBudget",\n  "description": "planningBudget validation model",\n  "type": "object",\n  "properties": {\n    "employeeId": {\n      "description": "employee master id of employee",\n      "type": "string"\n    },\n    "action": {\n      "description": "action of budget request",\n      "type": "string",\n      "enum": ["Approved", "Rejected", "Submitted"]\n    },\n    "budgetOptions": {\n       "description": "compensation increase type for update",\n      "type": "array",\n      "minItems": 1,\n      "items": {\n        "type": "object",\n        "$ref": "#/definitions/budgetType"\n      }\n    }\n  },\n  "required": [\n    "employeeId",\n    "action",\n    "budgetOptions"\n  ],\n   "definitions": {\n    "budgetType": {\n      "type": "object",\n      "properties": {\n        "id": {\n          "description": "compensation increase type id",\n          "type": "string"\n        }\n      }\n    }\n  }\n}', 'ACTIVE', '2018-03-23 10:56:46', '2019-03-30 13:49:11'),
