	(74, 1, 1, 'unlockUser', '{\n  "$schema": "http://json-schema.org/draft-04/schema#",\n  "title": "unlock",\n  "description": "unlock validation model",\n  "type": "object",\n  "properties": {\n    "password": {\n      "description": "password of user",\n      "type": "string",\n      "minLength": 6,\n      "maxLength": 10,\n      "pattern": "^[a-zA-Z0-9]{6,10}$"\n    }\n  },\n  "required": [\n    "password"\n  ]\n}', 'ACTIVE', '2018-03-23 10:56:46', '2018-10-07 22:10:13'),
	(75, 1, 1, 'oauth2', '{\n  "$schema": "http://json-schema.org/draft-04/schema#",\n  "title": "Authentication type of Oauth2",\n  "description": "Oauth2 validation model",\n  "anyOf": [\n   {\n      "$ref": "#/definitions/authenticationCode"\n    },\n    {\n      "$ref": "#/definitions/implict"\n    },\n    {\n      "$ref": "#/definitions/clientCredentials"\n    },\n    {\n      "$ref": "#/definitions/resourceCredentials"\n    }\n  ],\n  "definitions": {\n    "authenticationCode": {\n      "type": "object",\n      "properties": {\n        "webUrl": {\n          "$ref": "#/definitions/webUrl"\n        },\n        "clientId": {\n          "$ref": "#/definitions/clientId"\n        },\n        "clientSecret": {\n          "$ref": "#/definitions/clientSecret"\n        },\n        "authorizeUrl": {\n          "$ref": "#/definitions/authorizeUrl"\n        },\n        "accessTokenUrl": {\n          "$ref": "#/definitions/accessTokenUrl"\n        }\n      },\n      "required": [\n        "webUrl",\n        "clientId",\n        "clientSecret",\n        "authorizeUrl",\n        "accessTokenUrl"\n      ]\n    },\n    "implict": {\n      "type": "object",\n      "properties": {\n        "webUrl": {\n          "$ref": "#/definitions/webUrl"\n        },\n        "clientId": {\n          "$ref": "#/definitions/clientId"\n        },\n        "clientSecret": {\n          "$ref": "#/definitions/clientSecret"\n        }\n      },\n      "required": [\n        "webUrl",\n        "clientId",\n        "clientSecret"\n      ]\n    },\n    "clientCredentials": {\n      "type": "object",\n      "properties": {\n        "username": {\n          "$ref": "#/definitions/username"\n        },\n        "password": {\n          "$ref": "#/definitions/password"\n        }\n      },\n      "required": [\n        "username",\n        "password"\n      ]\n    },\n    "resourceCredentials": {\n      "type": "object",\n      "properties": {\n        "username": {\n          "$ref": "#/definitions/username"\n        },\n        "password": {\n          "$ref": "#/definitions/password"\n        }\n      },\n      "required": [\n        "username",\n        "password"\n      ]\n    },\n    "password": {\n      "description": "password",\n      "type": "string",\n      "min-length": 6,\n      "max-length": 10,\n      "pattern": "^[a-zA-Z0-9]{6,10}$"\n    },\n    "username": {\n      "description": "name",\n      "type": "string",\n      "minLength": 3,\n      "maxLength": 50,\n      "pattern": "^[-_ a-zA-Z0-9]{3,50}$"\n    },\n    "clientId": {\n      "description": "client identifier",\n      "type": "string",\n      "minLength": 3,\n      "maxLength": 200,\n      "pattern": "^[-_ a-zA-Z0-9]{3,200}$"\n    },\n    "clientSecret": {\n      "description": "client identifier",\n      "type": "string",\n      "minLength": 3,\n      "maxLength": 200,\n      "pattern": "^[-_ a-zA-Z0-9]{3,200}$"\n    },\n    "webUrl": {\n      "description": "web url",\n      "type": "string",\n      "minLength": 15,\n      "maxLength": 200\n    },\n    "authorizeUrl": {\n      "description": "authorize url",\n      "type": "string",\n      "minLength": 3,\n      "maxLength": 200,\n      "pattern": "^[-_ a-zA-Z0-9]{3,200}$"\n    },\n    "accessTokenUrl": {\n      "description": "access token url",\n      "type": "string",\n      "minLength": 3,\n      "maxLength": 200,\n      "pattern": "^[-_ a-zA-Z0-9]{3,200}$"\n    }\n  }\n}', 'ACTIVE', '2018-03-23 10:56:46', '2018-12-20 22:29:38'),
